import { useState, useEffect } from "react";

const Info = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/users")
      .then((res) => res.json())
      .then((actualData) => setData(actualData));
  }, []);

  const renderObj = () => {
    Object.keys(data).map((obj, i) => {
      return <div>{data[obj].name}</div>;
    });
  };

  return (
    <div className="info-container">
      <div className="info-data-text">{!data ? "Loading..." : "boop"}</div>
      <ul>{this.renderObj()}</ul>
    </div>
  );
};

export default Info;
